/**
 * 에러 페이지
 */
 import styled from 'styled-components';
 const NotFoundBlock = styled.div`
 position: fixed;
 width: 100%;
 background: white;
 box-shadow: 0px 2px 4px rgba(0, 0, 0, 0.08);

`;
const Box = styled.div`
width: 400px;
height:300px;
border: solid thin;

`
 const EditPostPage = () => {
   
   return (
   <NotFoundBlock>      
    <Box></Box>
   </NotFoundBlock>);
 };
 
 export default EditPostPage;
